import React, {useState} from 'react'
import {
  StyleSheet,
  Text,
  Button,
  View,
  Image,
  ImageBackground,
  TextInput,
  
} from 'react-native';
import './FilterCoffee.css';

import {AiOutlineSearch} from "react-icons/ai" 


const Filter = () => {

 const [Filter, setFilter] = useState('');
  return (
    <div>
        Filter
      <div className="row"> 
          <TextInput
            style={styles.input}
            placeholder='Filter'
            value={Filter.names}
            onChange={(e) => {
              setFilter(e.target.value)
              console.log(e.target.value)
            }}
            /> 

            <button>
              <AiOutlineSearch  />
            </button> 
         </div>  
         </div>
  )
}

export default Filter
